function ProjectSlides(props){
    return (
        <a href={props.link}>
<img onMouseEnter={props.mouseenter} onMouseLeave={props.mouseleave} className={props.classname} src={props.img} alt={props.alt} />
</a>
    )
}

export default ProjectSlides;
